body:
「ディオール」は人気腕時計「シフル ルージュ」コレクション誕生20周年を祝し、新モデルを発売。マットなブラックに、「シフル ルージュ」のシグネチャーである色鮮やかなレッドカラーがアクセント。身につけるだけで自信をもたらしくれそうな名品です。
【写真】人気ブランドの最旬時計
@BAILA
38mm 自動巻き ￥1120000

新生「シフル ルージュ」は、クールなウルトラマットブラックに、「シフル ルージュ」のシグネチャーである色鮮やかなレッドカラーが映え、ディオールの永遠の象徴である「カナージュ」デザインを全体に施したデザインが特徴。文字盤とローターに描かれる「カナージュ」は繊細、かつ華やかに細かなグラフィックがエングレービングされています。

ダイヤモンドの煌めきに溢れるケースや圧倒的な存在感で目を引くウルトラマットブラックケースなど異なる表情をみせるタイムレスなコンテンポラリーさが魅惑的な同コレクションは、38mmと41mmの2サイズの展開。また数量限定モデルも登場します。
@BAILA
41mm クロノグラフ 自動巻き ¥1900000
@BAILA
38mm 自動巻き ￥2300000 ※数量限定モデル
